import React from 'react';
import { useParams } from 'react-router-dom';

const StockDetails = () => {
  const { id } = useParams();
  return (
    <div>
      <h2>Stock Details for {id}</h2>
      <p>Chart and detailed stock info will be displayed here.</p>
    </div>
  );
};

export default StockDetails;
